import React, { Component } from 'react'

export class ApiPrice extends Component {
    constructor(props) {
        super(props)
        this.state = {
            data: false,
            ticker: 'NIO'

        }
    }

    componentDidMount() {
        let { ticker } = this.state
        let url = 'https://financialmodelingprep.com/api/v3/quote/' + ticker + "?apikey=e58839b47503a7c01847ea35b1e81bc2"
        fetch (url, {
            method: 'GET',
            headers: {
                'Accept' : 'application/json',
                'Content-Type':'application/json',
            }
        }).then((result) => {
            result.json().then((resp) => {
                this.setState({data: resp})
            })
        })
    }

    render() {
        const data = this.state.data
        console.warn(data)
        return (
            <div>
                {
                    data ?
                    <div>
                        <h1> {data[0].change} </h1>
                    </div>
                    :
                    <p> please wait for api...</p>

                }
            </div>
        )
    }
}

export default ApiPrice
